        path: "/email-wizard",
      },
    ],
  };

  routeTo = (product) => {
    this.props.history.push(product.path);
  };

  render() {
    return (
      <div className="app-container">
        <div className="row">
          {this.state.products.map((product) => (
            <div key={product._id} className="col-sm-12 col-md-4">
              <Card data={product} onRoute={this.routeTo} />
            </div>
          ))}
        </div>
      </div>
    );
  }
}

export default Home;
